-- ----------------------------
DROP TABLE IF EXISTS `sequence`;
CREATE TABLE `sequence` (
  `seq_name` varchar(32) CHARACTER SET latin1 NOT NULL,
  `current_val` int(11) NOT NULL,
  `increment_val` int(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`seq_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='自定义索引';

-- ----------------------------
-- Table structure for transfer_case_queue
-- ----------------------------
DROP TABLE IF EXISTS `transfer_case_queue`;
CREATE TABLE `transfer_case_queue` (
  `ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `LAB_SERVER_NO` varchar(16) NOT NULL COMMENT '实验室服务器编号',
  `CASE_ID` int(11) NOT NULL COMMENT '案件id',
  `TRANSFER_STATUS` varchar(4) DEFAULT NULL COMMENT '上报状态，字典：TRANSFER_STATUS 0待上报; 2上报成功; -2上报失败',
  `TRANSFER_FILE_ROOT_PATH` varchar(256) DEFAULT NULL COMMENT '上报文件根目录',
  `TRANSFER_FILE_NAME` varchar(128) DEFAULT NULL COMMENT '上报文件名称',
  `TRANSFER_ERROR_MSG` varchar(2048) DEFAULT NULL COMMENT '上报失败信息',
  `CREATE_DATETIME` timestamp NULL DEFAULT NULL,
  `UPDATE_DATETIME` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `TRANSFER_CASE_QUEUE_IDX1` (`LAB_SERVER_NO`),
  KEY `TRANSFER_CASE_QUEUE_IDX2` (`CASE_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 COMMENT='案件数据上报队列';

-- ----------------------------
-- Table structure for transfer_case_sample
-- ----------------------------
DROP TABLE IF EXISTS `transfer_case_sample`;
CREATE TABLE `transfer_case_sample` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `TRANSFER_CASE_QUEUE_ID` int(11) NOT NULL COMMENT '队列id',
  `DNA_SAMPLE_ID` int(11) NOT NULL COMMENT 'dna样本id',
  `TRANSFER_STATS` int(11) NOT NULL COMMENT '上报状态，0待上报;1上报成功;2上报失败',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 COMMENT='上报案件样本表';

-- ----------------------------
-- Table structure for transfer_criminal_queue
-- ----------------------------
DROP TABLE IF EXISTS `transfer_criminal_queue`;
CREATE TABLE `transfer_criminal_queue` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `LAB_SERVER_NO` varchar(16) CHARACTER SET latin1 NOT NULL,
  `PERSON_ID` int(11) NOT NULL,
  `TRANSFER_STATUS` varchar(4) CHARACTER SET latin1 DEFAULT NULL COMMENT '上报状态，0待上报;2上报成功;-2上报失败',
  `TRANSFER_FILE_ROOT_PATH` varchar(256) CHARACTER SET latin1 DEFAULT NULL COMMENT '上报文件根目录',
  `TRANSFER_FILE_NAME` varchar(128) CHARACTER SET latin1 DEFAULT NULL COMMENT '上报文件名称',
  `TRANSFER_ERROR_MSG` varchar(2048) CHARACTER SET latin1 DEFAULT NULL COMMENT '上报失败信息',
  `CREATE_DATETIME` timestamp NULL DEFAULT NULL,
  `UPDATE_DATETIME` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='上报建库人员队列';

-- ----------------------------
-- Function structure for currval
-- ----------------------------
DROP FUNCTION IF EXISTS `currval`;
delimiter ;;
CREATE DEFINER=`root`@`%` FUNCTION `currval`(v_seq_name VARCHAR(50)) RETURNS int(11)
begin
 declare value integer;
 set value = 0;
 select current_val into value  from sequence where seq_name = v_seq_name;
   return value;
end;
;;
delimiter ;

-- ----------------------------
-- Function structure for nextval
-- ----------------------------
DROP FUNCTION IF EXISTS `nextval`;
delimiter ;;
CREATE DEFINER=`root`@`%` FUNCTION `nextval`(v_seq_name VARCHAR(50)) RETURNS int(11)
begin
    update sequence set current_val = current_val + increment_val  where seq_name = v_seq_name;
    return currval(v_seq_name);
end;
;;
delimiter ;


